import React from 'react'
import { chats } from '../../db'

const ChatsList: React.FC = () => (
  <div>
    <ul>
      {chats.map((chat) => (
        <li key={chat.id}>
          <img src={chat.picture} alt="Profile" />
          <div>{chat.name}</div>
          {chat.lastMessage && (
            <React.Fragment>
              <div>{chat.lastMessage.content}</div>
              <div>{chat.lastMessage.createdAt}</div>
            </React.Fragment>
          )}
        </li>
      ))}
    </ul>
  </div>
);


export default ChatsList
